VALUES ('3180070845408', 'yaourt au lait entier nature', '@Yaourt nature au lait entier issu de l\'agriculture biologique @Yoghurt natuur van volle mel afkomstig van biologische landbo Origine / Oorsprong @ Ces yaourts natures Carrefour Bio s fabriqués à partir de lait entier collecté Francet @ Deze yoghurt natuur v Carrefour Bio,is vervaardigd van volle me die opgehaaldyprd in Frankrijk. p Ingré flnts / Ingrediënten @ Lait entier ià096%, poudre de IE écrémé bio, ferments laçlAues.@Volle biomelk 96%, magere biomelkpoeder, melkfermenten. Conservation / Bewaring @ A conserver entre OOC et +70C. A consommer jusqu\'au : voir sur le dessus de remballage.@ Te bewaren tussen OOC en +70C Te gebruiken tot: 125 zie datum bovenkant verpakking.', '', '3.4', '2.1', '4.1', '4.1', '', '3.9', '0.13', '0.0511811023622047', '', '1');

