VALUES ('3180071003067', 'Tortellini pesto', 'Farine de blé tendre 30,8%, semoule de blé dur 13,2%, œufs frais 1% (soit 140 g d\'œufs frais par kg de farine et semoule), ricotta 8,1%, chapelure (farine de blé, au, levure, sel), huile de tournesol, basilic 4%, flocons de pomme de terre (pomme de terre, \'mulsifiant : mono- et diglycérides d\'acides gras, stabilisant : diphosphates, antioxydant : esters \'acides gras de l\'acide ascorbique et disulfite de sodium, extraits naturels de curcuma et de paprika), préparation de fromage fondu 3,6% (fromage 1,5%, huile de tournesol, amidon de pomme de terre, eau, sel), poudre de lactosérum, fromage Pecorino 1,8%, fromage à pâte dure 1,3%, noix de cajou 0,9%, huile d\'olive 0,5%, sel, pignons de pin 0,18%, extrait de levure, ail 0,04%, arômes (contient let), antioxydant : acide ascorbique. Peut contenir des traces de fruits à coque, céleri, crustacés, mollusques et poisson.', '', '13', '2.9', '40', '6', '2.2', '9.8', '0.93', '0.366141732283465', '', '1');

